('2080','2','8273','Wohnung Vidal',Null,'Großzügig gestaltete Wohnung mit Meerblick in Palma','27055','In ruhiger und beliebter Wohnlage, direkt am Schlosspark vom Schloss Bellver gelegen, befindet sich dieses Wohnhaus mit nur 13 Luxuswohnungen. Diese Wohnung hat ca. 250 m² Wohnfläche, die sich auf  Diele, Wohn-Esszimmer, Küche, Hauswirtschaftsraum, Angestelltenzimmer mit Bad, Gäste-WC,  4 Schlafzimmer und 3 Badezimmer verteilt. Die Wohnung ist mit hochwertigen Materialien ausgestattet wie Marmorböden, Parkettböden in den Schlafzimmern, Service-Lift, Klima w/k und Ölzentralheizung und wird unmöbliert verkauft. \r\nZu Gemeinschaftseinrichtung gehören u.a. Lift, Hallenbad, 2 Saunen, Außenpool, großer Parkplatz und Tennisplatz. Ein privater Tiefgaragenplatz und ein privater Abstellraum gehören zur Wohnung.','27056','850000','111','2013-07-30 11:23:46','106','2013-07-30 11:24:22',Null,'1942','105','928',1,'1','0',Null,Null,Null,'27057',Null,'0','0','0',Null,'2015-11-11 09:54:22',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'27058',Null,'27059',Null,'27060',Null,'27061',Null,'27062','0',0,'0');
